import React, {  StrictMode } from 'react';
import { CookiesProvider } from 'react-cookie';
import ApiContextProvider from "./context/ApiContext";



import "./main.scss"

// ユーザー毎の機能
import Home from "./pages/Home"
import RecommendPosts from "./pages/ReccomendPosts";
import Recommend from "./pages/Recommend";
import Userpage from "./pages/Userpage";
import Recommenduser from "./pages/Recommenduser";
import Request from "./pages/Request";
import Users from "./pages/Users";
import Following from './pages/Following';
import MutualFollowing from './pages/MutualFollowing';

// 内容
import Mono from "./pages/Mono";
import SpecificUserpage from "./pages/SpecificUserpage";

// 初期設定
import Login from "./pages/Login";

// 設定
import Settings from "./pages/Settings";
import Account from "./pages/Account";

// アナリティクス
import Analytics from "./pages/Analytics";

import { BrowserRouter, Switch, Route  } from 'react-router-dom';

const App = () => {
    console.log(process.env.PUBLIC_URL)

        return(
            <ApiContextProvider>
            <StrictMode>
            <BrowserRouter basename="https://tatami-dev.com">
                <CookiesProvider>
                <Switch>
                    <Route exact path = "/" component={Login}/>
                    <Route path = "/home" component={Home}/>
                    <Route path = "/reccomendposts" component={RecommendPosts}/>
                    <Route path = "/recommend" component={Recommend}/>
                    <Route path = "/userpage" component={Userpage}/>
                    <Route path = "/recommenduser" component={Recommenduser}/>
                    <Route path = "/users" component={Users}/>
                    <Route path = "/mono" component={Mono}/>
                    <Route path = "/request" component={Request}/>
                    <Route path = "/login" component={Login}/>
                    <Route path = "/settings" component={Settings}/>
                    <Route path = "/account" component={Account}/>
                    <Route path = "/analytics" component={Analytics}/>
                    <Route path = "/specificuserpage" component={SpecificUserpage}/>
                    <Route path = "/following" component={Following}/>
                    <Route path = "/mutualfollowing" component={MutualFollowing}/>


                </Switch>
                </CookiesProvider>
            </BrowserRouter>
            </StrictMode>
            </ApiContextProvider>

        )

}


export default App;
